    if (countObjects() > 0) _user.user.notify('Вы вышли досрочно', 'error');

    _custom.CustomEvent.triggerServer('shooting:finish', id, countObjects() > 0, _system.system.timestampMS - startMS);

    colshape.destroy();
    colshape = null;
